package com.skg.file;

import java.io.BufferedInputStream;
import java.io.BufferedOutputStream;
import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;

public class BufferedIOStreamDemo {

	public static void main(String[] args) {
		File file = new File("file1.txt");
		FileInputStream fileInputStream = null;
		BufferedInputStream bufferedInputStream = null;
		FileOutputStream fileOutputStream = null;
		BufferedOutputStream bufferedOutputStream = null;
		String DataToWrite = "";
		try {

			fileInputStream = new FileInputStream(file);
			bufferedInputStream = new BufferedInputStream(fileInputStream);
			// Create buffer
			byte[] buffer = new byte[1024];
			byte[] bufferOutput = DataToWrite.getBytes();
			int bytesRead = 0;
			// Now single bufferReader read will read 1024 bytes of data.
			while ((bytesRead = bufferedInputStream.read(buffer)) != -1) {
				System.out.println("--------------------------------");
				System.out.println(new String(buffer, 0, bytesRead));
			}

			fileOutputStream = new FileOutputStream("bufferedIOdemo.txt");
			// We can provide the fixed Buffer Size.
			bufferedOutputStream = new BufferedOutputStream(bufferedOutputStream, bufferOutput.length + 1);
			
			bufferedOutputStream.write(bufferOutput);

		} catch (IOException e) {
			e.printStackTrace();
		} finally {
			try {
				if (fileInputStream != null) {
					fileInputStream.close();
				}
				if (bufferedInputStream != null) {
					bufferedInputStream.close();
				}
			} catch (IOException e) {
				e.printStackTrace();
			}

		}
	}
}




